import Users from './GetUsersList';

const MessagesUsersList = ({ user, onReload }) => {

  return (
    <div className="app">
      {/* {SendMessage(onReload)} */}
      <SendMessage user={userState} onRefresh={onReload}/>
      <div className="display-panel">
        {Users(user.users)}
        {Messages(user.messages)}
      </div>
    </div>
  );

};

export default MessagesUsersList;
